import { __decorate } from "tslib";
import { Component } from '@angular/core';
let LoginUserComponent = class LoginUserComponent {
    constructor(userLoginDTO, userService, router) {
        this.userLoginDTO = userLoginDTO;
        this.userService = userService;
        this.router = router;
    }
    async loginUser() {
        var result = await this.userService.LoginUser(this.userLoginDTO);
        if (result) {
            this.router.navigate(['']);
        }
        else {
            console.log("ошибка авторизации"); // TODO добавить отображение ошибки
        }
    }
};
LoginUserComponent = __decorate([
    Component({
        selector: 'login-user-component',
        templateUrl: 'loginUserComponent.html',
        providers: [],
        styles
    })
], LoginUserComponent);
export { LoginUserComponent };
